What are the pros and cons of each approach? When should I use React.cloneElement ?

## Answer

The first approach is the most common and the most readable. It is also the most performant, because React can optimize the rendering of the component.

The second approach is also common, but it is less readable and less performant, because React has to create a new object for the props.

The third approach is the least common and the least readable. It is also the least performant, because React has to create a new object for the props and then clone the element.

In general, you should use the first approach whenever possible. If you need to pass additional props to the component, you can use the second approach. If you need to pass additional props and also need to clone the element, you can use the third approach.

